  src: url("/643d1ddfa71631a7bd3d03e8ef71978f.ttf") format("ttf");
}
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body,
html {
  width: 100%;
  font-family: "Gill Sans", "Gill Sans MT", Calibri, "Trebuchet MS", sans-serif;
}

body {
  background-color: #030426;
}

button {
  cursor: pointer;
}

.btn {
  width: 10rem;
  height: 4rem;
  margin: 1rem 0 0 1rem;
  background-color: #7ad2bc;
  color: white;
  text-transform: uppercase;
  font-size: 2rem;
  font-family: "Gill Sans", "Gill Sans MT", Calibri, "Trebuchet MS", sans-serif;
  border: 1px solid white;
  border-radius: 5px;
}

.menu-icon {
  display: none;
  justify-content: center;
  align-items: center;
  width: 4rem;
  height: 4rem;
  cursor: pointer;
  transition: all 0.5s ease-in-out;
  z-index: 99;
}

.menu-icon-burger {
  width: 2.5rem;
  height: 4px;
  background: #7ad2bc;
  border-radius: 5px;
  transition: all 0.5s ease-in-out;
}

.menu-icon-burger::before,
.menu-icon-burger::after {
  content: "";
  position: absolute;
  width: 2.5rem;
  height: 4px;
  background: #7ad2bc;
  transition: all 0.5s ease-in-out;
}

.menu-icon-burger::before {
  transform: translateY(-16px);
}

.menu-icon-burger::after {
  transform: translateY(16px);
}

.menu-icon.open .menu-icon-burger {
  background: transparent;
}

.menu-icon.open .menu-icon-burger::before {
  transform: rotate(45deg);
}

.menu-icon.open .menu-icon-burger::after {
  transform: rotate(-45deg);
}

@media screen and (max-width: 768px) {
  .menu-icon {
    display: flex;
  }
}
@media screen and (max-width: 768px) {
  .hero {
    background-position: center;
  }
}

.section--hero {
  background-image: url("/9a4ace62fc1752ea3721ce14528bc843.jpg");
  background-position: center;
  height: calc(100vh - 7rem);
  width: 100%;
  background-size: cover;
  background-repeat: no-repeat;
}

.overlay {
  height: 100%;
  width: 100%;
  background: rgba(0, 0, 0, 0.6);
}

.hero-container {
  width: 75%;
  margin: 0 auto;
  padding: 7rem;
  height: 100%;
  display: flex;
  flex-direction: column;
}

.hero-heading {
  color: white;
  height: fit-content;
  width: fit-content;
  font-size: 6rem;
  text-transform: uppercase;
  font-family: "Architect";
}

#logo {
  border-radius: 50%;
  position: relative;
  margin-bottom: -3rem;
  z-index: 99;
}

#logo img {
  width: 12rem;
}

@media screen and (max-width: 768px) {
  #logo img {
    width: 9rem;
  }

  #logo {
    margin-left: -1rem;
  }
}
.section--schedule {
  background-color: #fdfff4;
}

.schedule-container {
  width: 65%;
  margin: 0 auto;
  color: #7ad2bc;
  padding: 4rem;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
}

.day {
  border-bottom: 1px solid gray;
  display: flex;
  justify-content: flex-start;
  padding: 1rem 1rem;
}

.day-date {
  display: flex;
  flex-direction: column;
  text-align: center;
  justify-content: center;
}

.weekday {
  font-size: 1.2rem;
}

.number {
  font-size: 3rem;
}

.month {
  font-size: 1.2rem;
}

.day-info {
  display: flex;
  flex-direction: column;
  margin-left: 5rem;
  justify-content: center;
}

.location {
  font-size: 2.2rem;
  margin-bottom: 0.5rem;
  text-transform: uppercase;
  font-weight: 600;
}

.time {
  font-size: 1.3rem;
}

@media screen and (max-width: 768px) {
  .day {
    flex-direction: column;
  }

  .day-info,
.location,
.time {
    margin: 0;
    text-align: center;
  }

  .schedule-container .section-heading {
    border-bottom: 1px solid #030426;
  }
}
.section {
  overflow: hidden;
}
@media screen and (max-width: 768px) {
  .section {
    display: flex;
    flex-direction: column;
  }
}

.section-heading {
  font-size: 2.5rem;
  margin: 0 auto 2rem;
  text-transform: uppercase;
  text-align: center;
  font-family: "Architect";
}

.section--social-media {
  background-color: #ea8a48;
}

.social-media-container {
  width: 75%;
  margin: 0 auto;
  color: white;
  padding: 4rem;
  height: 100%;
  display: flex;
  flex-direction: column;
}

.social-bar {
  width: 50%;
  margin: 0 auto;
  padding: 1rem;
  display: flex;
  justify-content: center;
}

.social-icon {
  font-size: 4rem;
  color: #7ad2bc;
  margin: 0 1.5rem;
}

